import { Box, Grid, Typography } from "@mui/material";
import React from "react";

export default function Page2() {
    return (
        <>
            <Grid container>
            <Grid
      item
      xs={3}
      sx={{ height: '500px', backgroundColor: 'gray', position: 'relative', overflowY: 'auto' }}
    >
      <Typography variant="h5" sx={{ mt: '2%', textAlign: 'center' }}>
        Assets
      </Typography>
      <Box
        sx={{
          height: 'calc(100% - 50px)', // Adjusted height to accommodate bottom content
          overflowY: 'auto',
          paddingBottom: '50px', // Added padding bottom equivalent to the height of bottom content
        }}
      >
        <Box
          container
          sx={{
            mt: '2%',
            display: 'flex',
            justifyContent: 'space-evenly',
            alignItems: 'center',
            flexDirection: 'column',
            width: '100%'
          }}
        >
          {/* Your Box containers and Grid items */}
        </Box>
        {/* Repeat the above Box container as needed */}
      </Box>
      <Grid
        container
        sx={{ backgroundColor: 'yellow', height: '50px', position: 'absolute', bottom: '0', width: '100%' }}
      >
        <Typography variant="body1" align="center">
          Bottom Content
        </Typography>
      </Grid>
    </Grid>

                <Grid item xs={6} sx={{ height: '200px', backgroundColor: 'blue' }}>

                </Grid>
                <Grid item xs={3} sx={{ height: '200px', backgroundColor: 'green', }}>

                </Grid>
            </Grid>
        </>
    );
}
